import React, { useEffect, useState } from 'react';
import Answer from './Answer';

function Question({quesNo, quesText, quesType, answerList})
{
    console.log('In Question');
    return(
        <tr>
            <td>
                <label>{`${quesNo}`}</label>
            </td>
            <td>
                <label>{`${quesText}`}</label>

                <table className='table table-primary w-100'>
                    <tbody>
                        {answerList.map((element, index)=>(<Answer key = {index} quesType = {quesType} quesNo = {quesNo} ansNo = {element.ansNo} ansText = {element.ansText}/>))}
                    </tbody>
                </table>
            </td>
            
        </tr>
    );
}

export default Question;
